import React, { useState } from 'react';

const InnerModal = ({ onCloseSelf }) => {
  const handleSelfClose = () => {
    onCloseSelf();
  };

  return (
    <div className="inner-modal">
      <h2>Contenido del Modal Interno</h2>
      <button onClick={handleSelfClose}>Cerrar Modal Interno</button>
    </div>
  );
};

const ModalChild = ({ onCloseSelf, onCloseParent }) => {
  const handleSelfClose = () => {
    onCloseSelf();
  };

  const handleParentClose = () => {
    onCloseParent();
  };

  return (
    <div>
      <h2>Contenido del Modal Hijo</h2>
      <button onClick={handleSelfClose}>Cerrar Modal Hijo</button>
      <button onClick={handleParentClose}>Cerrar Modal Padre</button>

      {/* Nuevo Modal Anidado */}
      <InnerModal onCloseSelf={handleSelfClose} />
    </div>
  );
};

const ModalParent = () => {
  const [isModalOpen, setModalOpen] = useState(false);

  const openModal = () => {
    setModalOpen(true);
  };

  const closeModal = () => {
    setModalOpen(false);
  };

  return (
    <div>
      <button onClick={openModal}>Abrir Modal Padre</button>

      {isModalOpen && (
        <div className="modal-overlay">
          <div className="modal-content">
            <ModalChild onCloseSelf={closeModal} onCloseParent={closeModal} />
          </div>
        </div>
      )}
    </div>
  );
};

const App = () => {
  return (
    <div>
      <ModalParent />
    </div>
  );
};

export default App;
